define({"topics" : [{"title":"About Resource Path Discovery","shortdesc":"\n               <p class=\"shortdesc\">The enrollment process involves discovering file shares defined on network hosts, and         then enrolling them into the\n                  Information Network Directory.\n               </p>\n            ","href":"about_resource_path_discovery.html","attributes": {"data-id":"about_resource_path_discovery",},"menu": {"hasChildren":false,},"tocID":"about_resource_path_discovery-d66e1212","next":"about_resource_path_discovery-d66e1212",},{"title":"Enrolling location sites","shortdesc":"\n               <p class=\"shortdesc\">A location site is a Control Center term referring to a group of hosts that you want         to consider as a single location\n                  because they share certain characteristics.\n               </p>\n            ","href":"enrolling_location_sites.html","attributes": {"data-id":"enrolling_location_sites",},"menu": {"hasChildren":false,},"tocID":"enrolling_location_sites-d66e1259","topics":[]},{"title":"Enrolling SharePoint groups","shortdesc":"\n               <p class=\"shortdesc\">The SharePoint Enforcer is available exclusively with the Entitlement Management         product. If you are not using that\n                  product, you can ignore this section.\n               </p>\n            ","href":"enrolling_sharepoint_groups.html","attributes": {"data-id":"enrolling_sharepoint_groups",},"menu": {"hasChildren":false,},"tocID":"enrolling_sharepoint_groups-d66e1270","next":"enrolling_sharepoint_groups-d66e1270",},{"title":"Enrollment utility password requirements","shortdesc":"\n               <p class=\"shortdesc\">Some enrollment utilities require users to enter the password of the super user         Administrator account, which is initially\n                  configured during Control Center installation.         This password can be changed as needed.\n               </p>\n            ","href":"enrollment_utility_password_requirements.html","attributes": {"data-id":"enrollment_utility_password_requirements",},"menu": {"hasChildren":false,},"tocID":"enrollment_utility_password_requirements-d66e1325","topics":[]}]});